Three-ways, anals, bangouts, creampies and much more rule the day as Centuaro's camera is turned loose on such chesty beauties as Kathia and Yoha. And while Centauro saves most of the study honors for himself, he also doles out scenes to some of the finest woodmen in the European arena, including Zenza Raggi, Titus Steele, and Kid Jamaica!
